text:
I&#x27;m subscribing to the regular RSS feed [1], in which the individual list items in my RSS reader are links to the submitted pages. I&#x27;d rather have a feed with links to the comment pages, as I use HN mostly to read the contextual discussion. I see that the feed does contain the comments, like<p><pre><code>  &lt;comments&gt;https:&#x2F;&#x2F;news.ycombinator.com&#x2F;item?id=34184163&lt;&#x2F;comments&gt;
</code></pre>
So it should be fairly trivial to build a proxy that does what I want. Doing this would be a nice little exercise, but I don&#x27;t want to re-invent the wheel if it already exists.<p>[1] https:&#x2F;&#x2F;news.ycombinator.com&#x2F;rss
